import './dogDetail.css'
import { Link } from "react-router-dom";
import { getRaceDetail } from "../../Redux/actions";

import React, { useEffect } from "react";
import fondoDefault from '../../img/fondohome1.jpg';
import { useDispatch, useSelector } from 'react-redux';




function DogDetail(props){

const dispatch = useDispatch();
const raceDetail = useSelector(state => state.raceDetail);

const id = props.match.params.id;


useEffect(() =>{
dispatch(getRaceDetail(id))
}, [dispatch, id])


  return (
    <div key={id}>



           <div>
              <Link to='/home' id="click">
                 <button className="buttonVolverD">VOLVER</button>
              </Link>
           </div> 
{raceDetail.length > 0 ? 
           <div>

               <div  >
                   <img src={raceDetail[0].image? raceDetail[0].image : fondoDefault} alt="La imagen no se encuentra" className="imageDetail"/>
               </div>
               <div>{raceDetail.name}</div>
               <div>Temperamentos</div>
               <div>{raceDetail.temperament}</div>
               <div>Peso</div>
               <div >{raceDetail.weight} kg</div>
               <div>Altura</div>
               <div>{raceDetail[0].height} cm </div>
               <div>AÃ±os de vida</div>
               <div className="liveDetail">{raceDetail[0].life_span}</div>

            </div>
            : <p>Volver</p>
    } </div>
    )
}
export default DogDetail;
